styles.content:
self {
  text-align: center;
  font-size: 16px;
  transition: 0.2s;
  border-bottom: 0.2rem solid;
	border-color: transparent;
	cursor: pointer;
}

self:hover {
  border-bottom: 0.2rem solid;
	border-color: #f7ce46;

}

@keyframes fade {
  from {
    opacity: 0;
  }
  to {
    opacity: 1;
  }
}

self {
  transition: transform 0.3s ease-in-out;
 	height: 200px;
}

self:hover {
	  background-image: linear-gradient(to bottom, rgba(0,0,0,0), rgb(0, 0, 0, 0.4));
    animation: fade 0.2s ease-in-out;
}

self:hover >.job_cell_icon {
  -ms-transform: scale(1);
  -webkit-transform: scale(1);
  transform: scale(1); 
}

self {
transition: transform 0.3s ease-in-out;
transform: scale(0); 
box-shadow: rgba(0, 0, 0, 0.25) 0px 54px 55px, rgba(0, 0, 0, 0.12) 0px -12px 30px, rgba(0, 0, 0, 0.12) 0px 4px 6px, rgba(0, 0, 0, 0.17) 0px 12px 13px, rgba(0, 0, 0, 0.09) 0px -3px 5px;
}

self {
	background-color: #ffffffff;
}

self:hover {
	background-color: #ffffffff;
}
self:hover >.job_listings_title_color {
	color: rgb(99, 99, 99);
}
